        <Container fluid style={{ paddingLeft: 0, paddingRight: 0, backgroundColor: 'red' }}>
            <Row>
                <Col sm={8}>sm=8</Col>
                <Col sm={4}>sm=4</Col>
            </Row>
            <Row>
                <Col sm>sm=true</Col>
                <Col sm>sm=true</Col>
                <Col sm>sm=true</Col>
            </Row>
        </Container>
    )
}

export default Example;
